func Test_hitBricks(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, hitBricks(tc.grid, tc.hits), ":%v", tc)
	}
}

func Benchmark_hitBricks(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			hitBricks(tc.grid, tc.hits)
		}
	}
}
